<script type="text/javascript">
function call() {
	var context="http://localhost:6100/"
	var strURL=context+"run"
	$.ajax({
		type : "GET",
		url : strURL,
		cache : false,
		async : false,
		timeout : 60000,
		success : function(data) {
			if(data=='OK'){
				window.location.href=context;
			}
		},
		error: function(x, t, m){
			setInterval(function(){ 
				    $("#sId").hide();
					$("#eId").show();
		    }, 60000);
		}
	});

}
$(document).ready(function () {
    setInterval(function(){ 
    	call();
    }, 5000);
});
</script>
